import React from 'react';
import './TimelineStyles.css';

import {
  FaHtml5, FaCss3Alt, FaJs, FaPython, FaJava, FaReact, FaNodeJs,
  FaAws, FaGitAlt, FaGithub, FaAndroid, FaFigma, FaPalette,
  FaEnvelopeOpenText, FaServer, FaCode, FaDashcube
} from "react-icons/fa";

import {
  SiExpress, SiMongodb, SiPostman, SiVscode,
  SiCanva, SiDart, SiMachinelearning, SiDeepin, SiNumpy
} from "react-icons/si";

import { TbBrain, TbLanguage } from "react-icons/tb";
import { AiOutlineEye } from "react-icons/ai";

export default function Skills() {
  const skills = [
    "HTML", "CSS", "JavaScript", "Python", "Java", "React",
    "AWS", "GitHub", "Node.js", "MySQL", "MongoDB",
    "Tailwind CSS", "Bootstrap", "Firebase", "Express.js"
  ];

  return (
   <section className="skills-section">
  <h2 className="section-title">My Skills</h2>
  <div className="skills-grid">

    <div className="skill-card"><FaHtml5 /> HTML</div>
    <div className="skill-card"><FaCss3Alt /> CSS</div>
    <div className="skill-card"><FaJs /> JavaScript</div>
    <div className="skill-card"><FaPython /> Python</div>
    <div className="skill-card"><FaJava /> Java</div>
    <div className="skill-card"><SiDart /> Dart</div>
    <div className="skill-card"><FaReact /> React</div>
    <div className="skill-card"><FaReact /> React Native</div>

    <div className="skill-card"><FaNodeJs /> Node.js</div>
    <div className="skill-card"><SiExpress /> Express</div>
    <div className="skill-card"><TbBrain /> Machine Learning</div>
    <div className="skill-card"><SiDeepin /> Deep Learning</div>
    <div className="skill-card"><TbLanguage /> NLP</div>

    <div className="skill-card"><AiOutlineEye /> Computer Vision</div>
    <div className="skill-card"><FaAws /> AWS</div>
    <div className="skill-card"><FaGitAlt /> Git</div>
    <div className="skill-card"><FaGithub /> GitHub</div>
    <div className="skill-card"><FaEnvelopeOpenText /> Postman</div>
    <div className="skill-card"><FaAndroid /> Android Studio</div>
    <div className="skill-card"><FaCode /> VS Code</div>

    <div className="skill-card"><FaFigma /> Figma</div>
    <div className="skill-card"><FaPalette /> Canva</div>

  </div>
</section>


  );
}
